import { MapForm } from "../components/Forms/CRUD/MapForm";
import api from "../services/api";
import { onSubmitProps, User } from "../interfaces";
import { Auth } from "../hooks/useAuth";
import { AxiosRequestConfig } from "axios";


async function onSubmit(props: onSubmitProps) {

    if (!props.file || !props.map) {
        return;
    }

    try{
        const formData = new FormData();

        formData.append('file', props.file);
        formData.append('request', JSON.stringify(props.map));

        console.log(formData.get('request'));

        const config: AxiosRequestConfig = {
            url: '/api/Data/mapas',
            method: 'post',
            responseType: 'json',
            data: formData,


            headers: {
                'Content-Type': 'multipart/form-data',
                authorization: 'Bearer ' + props.token,
            },
            onUploadProgress: (progressEvent) => {
                console.log(progressEvent.loaded / progressEvent.total);
            },

        }

        await api.request(config);

        window.location.href='/'+props.map?.map_id;
    } catch (err) {
        console.log(err);
    }
}

function onCancel() {
    console.log("Cancel");
}

export const Upload: React.FC = () => {    
    const { user, check, err } = Auth<User | null>('api/Auth/perfil');
    const token = user?.token;

    return (
        <MapForm {...{ token, onSubmit, onCancel}}/>
    );
}
